import "./BoutiqueMenu.css";
import { useDispatch } from "react-redux";
import { fetchProducts, fetchBonnet, fetchTourDeCou, fetchPull, fetchGant, fetchChaussette, fetchChausson, fetchPlaide, fetchPelote } from "../../redux/products/productsReducer";

export default function BoutiqueMenu() {
  const dispatch = useDispatch();

  const afficheToutLesArticles = () => {
    dispatch(fetchProducts());
  };

  const afficheBonnet = () => {
    dispatch(fetchBonnet());
  };

  const afficheTourDeCou = () => {
    dispatch(fetchTourDeCou());
  };

  const affichePull = () => {
    dispatch(fetchPull());
  };

  const afficheGant = () => {
    dispatch(fetchGant());
  };

  const afficheChaussette = () => {
    dispatch(fetchChaussette());
  };

  const afficheChausson = () => {
    dispatch(fetchChausson());
  };

  const affichePlaide = () => {
    dispatch(fetchPlaide());
  };

  const affichePelote = () => {
    dispatch(fetchPelote());
  };

  return (
    <ul className="container-boutique-menu">
      <li className="item" onClick={afficheToutLesArticles}>
        Tout les articles
      </li>
      <li className="item" onClick={afficheBonnet}>
        Bonnet
      </li>
      <li className="item" onClick={afficheTourDeCou}>
        Tour de cou
      </li>
      <li className="item" onClick={affichePull}>
        Pull
      </li>
      <li className="item" onClick={afficheGant}>
        Gant
      </li>
      <li className="item" onClick={afficheChaussette}>
        Chaussette
      </li>
      <li className="item" onClick={afficheChausson}>
        Chausson
      </li>
      <div className="item" onClick={affichePlaide}>
        Plaide
      </div>
      <div className="item" onClick={affichePelote}>
        Pelote
      </div>
    </ul>
  );
}
